import classes from "./App.module.css"; //We need to create a name so we may reference when calling the styles from the modeule.css
import amazon from "./amazon.png"; // Importing an image from my local storage.
import ProductData from "./ProductData";
import ProductPreview from "./ProductPreview";

function App() {
  return (
    <div className="App">
      <header className="App-header">
        {/* CREATE A HEADING */}
        <nav className={classes.Topbar}>
          {/* Referencing a class from a module.css */}
          <img src={amazon} alt="" />
        </nav>
      </header>

      {/* CREATING THE PRODUCT PREVIEW CONTAINER */}
      <div className={classes.MainContainer}>
        {/* Product preview */}
        <div className={classes.ProductPreview}>
          <ProductPreview />
        </div>
      </div>
    </div>
  );
}

export default App;
